window.bookSummaryJSON = "<p><b>The Lich King Adriel is gone and Earth has avoided being drowned in deadly Miasma.</b></p> <p>Yet an even greater dangers lurks in the dark, and Zac is running against the clock. The Great Redeemer bears down on their planet, guided by Void's Disciple and his children.</p> <p>Everything points toward the mysterious base built by the Technocrats. That's where the Dominators are hiding, and even the remaining invaders have set their sights on the powerful treasure within.</p> <p>And it might even be the key to solve the mystery of Zac's background.</p> <p><b>Book 6 of the hit Defiance of the Fall LitRPG series. Grab your copy today!</b></p> <p><b>About the Series</b>: Jump into a story that merges Apocalyptic LitRPG elements with eastern cultivation. Class systems, skill systems, endless choices for progression, it has everything fans of the genre love. Explore a vast universe full of mystery, adventure, danger and even aliens; where even a random passer-by might hold the power of a god. Follow Zac as he struggles to stake out a unique path to power as a mortal in a world full of cultivators.</p>"; 
